package com.hhzmy.bean;

public class Pages {
	private String name;
	private int resId;
	public Pages() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getResId() {
		return resId;
	}
	public void setResId(int resId) {
		this.resId = resId;
	}
	public Pages(String name, int resId) {
		super();
		this.name = name;
		this.resId = resId;
	}
	


}
